-- ----------------------------
-- Table structure for done_money
-- ----------------------------
DROP TABLE IF EXISTS `done_money`;
CREATE TABLE `done_money` (
  `orderNum` char(18) NOT NULL COMMENT '订单编号',
  `driverId` char(20) NOT NULL DEFAULT '' COMMENT '司机ID',
  `insuranceFee` decimal(7,2) DEFAULT NULL COMMENT '报价费',
  `floorFee` decimal(7,2) DEFAULT NULL COMMENT '上楼费',
  `handlingFee` decimal(7,2) DEFAULT NULL COMMENT '装卸费',
  `freightFee` decimal(7,2) DEFAULT NULL COMMENT '运输费',
  `driverMoney` decimal(7,2) DEFAULT '0.00' COMMENT '司机金额',
  `totalMoney` decimal(7,2) NOT NULL DEFAULT '0.00' COMMENT '订单金额',
  `settle` tinyint(1) NOT NULL DEFAULT '0' COMMENT '结算状态（0：未支付；1：已支付；2：部分支付,3:司机代收）',
  `settleAmount` decimal(7,2) NOT NULL DEFAULT '0.00' COMMENT '待支付金额',
  `driverSettle` tinyint(1) DEFAULT '0' COMMENT '司机结算状态（0：未结算；1：已结算）',
  `payTime` datetime DEFAULT NULL COMMENT '支付时间',
  `dGrade` tinyint(1) NOT NULL DEFAULT '5' COMMENT '星级评分(0~5)',
  `hasGrade` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否已评分(0:未评分,1:客户已评分,2:超时自动评分)',
  `assessment` varchar(255) NOT NULL DEFAULT '' COMMENT '评价详情',
  `assessTime` datetime DEFAULT NULL COMMENT '评分时间(客户评分时间 或者 系统自动评分时间)',
  `payment` tinyint(1) DEFAULT NULL COMMENT '支付方式(1:支付宝;2:微信3:银联)'
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

