-- ----------------------------
-- Table structure for done_order
-- ----------------------------
DROP TABLE IF EXISTS `done_order`;
CREATE TABLE `done_order` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `orderNum` char(18) NOT NULL COMMENT '订单编号',
  `orderStatus` tinyint(1) NOT NULL DEFAULT '1' COMMENT '订单状态（0：待结算；1完成；2改派；5:异常;6：已关闭；7：已取消）',
  `driverId` char(20) NOT NULL DEFAULT '' COMMENT '司机ID',
  `vehicleId` char(20) DEFAULT NULL COMMENT '车辆ID',
  `customerId` char(20) NOT NULL COMMENT '客户ID',
  `deliver` char(30) NOT NULL COMMENT '发货人姓名',
  `deliverTel` char(12) NOT NULL COMMENT '发货人电话',
  `sCompany` varchar(20) NOT NULL COMMENT '发货单位',
  `sProvance` char(10) NOT NULL COMMENT '发货省市',
  `deliverAddr` varchar(255) NOT NULL COMMENT '发货地址',
  `receipt` char(30) NOT NULL COMMENT '收货人姓名',
  `receiptTel` char(12) NOT NULL COMMENT '收货人电话',
  `rCompany` varchar(20) NOT NULL COMMENT '收货单位',
  `rProvance` char(10) NOT NULL COMMENT '目的地省市',
  `receiptAddr` varchar(255) NOT NULL COMMENT '目的地地址',
  `rounteId` bigint(20) DEFAULT NULL COMMENT '路线ID',
  `volume` decimal(7,1) NOT NULL COMMENT '体积(立方米)',
  `weight` decimal(7,1) NOT NULL COMMENT '重量（千克）',
  `length` decimal(11,1) DEFAULT NULL COMMENT '长（厘米）',
  `wide` decimal(11,1) DEFAULT NULL COMMENT '宽（厘米）',
  `tall` decimal(11,1) DEFAULT NULL COMMENT '高（厘米）',
  `goodsNum` int(11) DEFAULT NULL COMMENT '货物数量',
  `description` varchar(255) DEFAULT NULL COMMENT '货物描述',
  `payMethod` tinyint(1) NOT NULL DEFAULT '1' COMMENT '付费方式（1：现金支付；2：在线支付；3：协议付款）',
  `createTime` datetime NOT NULL COMMENT '订单创建时间',
  `takersTime` datetime DEFAULT NULL COMMENT '司机接单时间',
  `callTime` datetime DEFAULT NULL COMMENT '预约取货时间',
  `pickupTime` datetime DEFAULT NULL COMMENT '实际取货时间',
  `updateTime` int(11) DEFAULT NULL COMMENT '更新时间',
  `leadTime` datetime DEFAULT NULL COMMENT '交货时间',
  `exceptionReasonId` tinyint(2) NOT NULL DEFAULT '0' COMMENT '选择的异常',
  `exceptionReason` varchar(255) DEFAULT NULL COMMENT '异常原因',
  `addRequir` varchar(255) DEFAULT NULL COMMENT '额外需求',
  `callImg` varchar(255) DEFAULT NULL COMMENT '取货照片',
  `leadImg` varchar(255) DEFAULT NULL COMMENT '交货照片',
  `exceptionImg` varchar(255) DEFAULT NULL COMMENT '异常图片',
