-- Table structure for driver_withdraw
-- ----------------------------
DROP TABLE IF EXISTS `driver_withdraw`;
CREATE TABLE `driver_withdraw` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `driverId` char(20) NOT NULL COMMENT '司机ID',
  `driverName` char(20) NOT NULL COMMENT '司机姓名',
  `bankNum` bigint(19) NOT NULL COMMENT '银行卡号',
  `bankName` char(30) NOT NULL COMMENT '银行名称',
  `branch` varchar(255) NOT NULL COMMENT '支行',
  `money` decimal(7,2) NOT NULL DEFAULT '0.00' COMMENT '提现金额',
  `createTime` datetime NOT NULL COMMENT '申请时间',
  `payTime` datetime DEFAULT NULL COMMENT '支付时间',
  `isPay` tinyint(1) NOT NULL DEFAULT '0' COMMENT '提现结果（0：未处理;1:提现成功;2:拒绝）',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8;

