-- ----------------------------
-- Table structure for examination_admin
-- ----------------------------
DROP TABLE IF EXISTS `examination_admin`;
CREATE TABLE `examination_admin` (
  `adminId` int(11) NOT NULL AUTO_INCREMENT,
  `adminName` varchar(255) NOT NULL,
  `password` varchar(255) DEFAULT NULL,
  `level` tinyint(1) DEFAULT NULL COMMENT '0:教委 ,1:学校，2:录入人员，3:学生',
  `relatedId` bigint(20) DEFAULT NULL COMMENT '可以为学校Id和学生Id',
  PRIMARY KEY (`adminId`),
  UNIQUE KEY `adminId_UNIQUE` (`adminId`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of examination_admin
-- ----------------------------

-- ----------------------------
-- Table structure for examination_class
-- ----------------------------
DROP TABLE IF EXISTS `examination_class`;
CREATE TABLE `examination_class` (
  `classId` int(11) NOT NULL,
  `grade` varchar(50) DEFAULT NULL,
  `class` varchar(50) DEFAULT NULL,
  PRIMARY KEY (`classId`),
  UNIQUE KEY `classId_UNIQUE` (`classId`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of examination_class
-- ----------------------------

-- ----------------------------
-- Table structure for examination_school
-- ----------------------------
DROP TABLE IF EXISTS `examination_school`;
CREATE TABLE `examination_school` (
  `schoolId` int(11) NOT NULL AUTO_INCREMENT,
  `schoolNo` varchar(50) NOT NULL,
  `schoolName` varchar(100) NOT NULL,
  `address` varchar(255) NOT NULL,
  `level` int(1) DEFAULT NULL,
  `postalCode` varchar(100) DEFAULT NULL,
  `limkMan` varchar(100) DEFAULT NULL,
  `telephone` varchar(20) DEFAULT NULL,
  `note` text,
  PRIMARY KEY (`schoolId`,`schoolNo`),
  UNIQUE KEY `schoolId_UNIQUE` (`schoolId`),
  UNIQUE KEY `schoolNo_UNIQUE` (`schoolNo`),
  KEY `fk_level_idx` (`level`),
  CONSTRAINT `fk_level` FOREIGN KEY (`level`) REFERENCES `examination_school_level` (`levelId`) ON DELETE SET NULL ON UPDATE SET NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of examination_school
-- ----------------------------

-- ----------------------------
-- Table structure for examination_school_level
-- ----------------------------
DROP TABLE IF EXISTS `examination_school_level`;
CREATE TABLE `examination_school_level` (
  `levelId` int(11) NOT NULL,
  `levelName` varchar(50) NOT NULL COMMENT '学校办学层次（小 初 高）',
  `lengthYear` varchar(50) DEFAULT NULL COMMENT '学制信息（六三 五四 五三）',
  PRIMARY KEY (`levelId`),
  UNIQUE KEY `levelId_UNIQUE` (`levelId`),
  UNIQUE KEY `levelName_UNIQUE` (`levelName`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of examination_school_level
-- ----------------------------

-- ----------------------------
-- Table structure for examination_student
-- ----------------------------
DROP TABLE IF EXISTS `examination_student`;
CREATE TABLE `examination_student` (
  `studentId` bigint(20) NOT NULL AUTO_INCREMENT,
  `studentNo` varchar(50) NOT NULL,
  `idCard` varchar(50) NOT NULL,
  `studentName` varchar(100) NOT NULL,
  `sex` tinyint(1) DEFAULT NULL,
  `birthDay` date DEFAULT NULL,
  `nationality` varchar(50) DEFAULT NULL,
  `enrollmentTime` date DEFAULT NULL,
  `telephone` varchar(20) DEFAULT NULL,
  `address` varchar(255) DEFAULT NULL,
  `classId` int(11) DEFAULT NULL,
  PRIMARY KEY (`studentId`,`studentNo`),
  UNIQUE KEY `studentId_UNIQUE` (`studentId`),
  UNIQUE KEY `studentNo_UNIQUE` (`studentNo`),
  UNIQUE KEY `idCard_UNIQUE` (`idCard`),
