  `handlingFee` decimal(7,2) NOT NULL DEFAULT '0.00' COMMENT '装卸费',
  `freightFee` decimal(7,2) NOT NULL DEFAULT '0.00' COMMENT '运输费',
  `driverMoney` decimal(7,2) NOT NULL DEFAULT '0.00' COMMENT '司机金额',
  `totalMoney` decimal(7,2) NOT NULL DEFAULT '0.00' COMMENT '总金额',
