  `settleAmount` decimal(7,2) DEFAULT NULL,
  `payment` tinyint(1) DEFAULT NULL COMMENT '支付方式(1:支付宝;2:微信3:银联)',
  UNIQUE KEY `orderNum` (`orderNum`,`driverId`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

