-- ----------------------------
-- Table structure for wallet_calendar
-- ----------------------------
DROP TABLE IF EXISTS `wallet_calendar`;
CREATE TABLE `wallet_calendar` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `expenseId` bigint(20) NOT NULL COMMENT '消费流水ID',
  `RDType` tinyint(1) NOT NULL DEFAULT '0' COMMENT '收支(0:支出;1:收入)',
  `customerId` char(20) NOT NULL COMMENT '客户ID',
  `money` decimal(7,2) NOT NULL COMMENT '金额',
  `payTime` int(11) NOT NULL COMMENT '支付时间',
  `payment` tinyint(1) NOT NULL DEFAULT '1' COMMENT '支付方式（1:支付宝;2:微信;3:银联）',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

